class JsonValidator():
	"""docstring for JsonValidator"""
	def __init__(self,schema,file):
		super(JsonValidator, self).__init__()
		self.schema = schema
		self.file = file
		self.prefix = ''
		self.keys = None
		self.tempkey = []
		self.test_param_file()

	def test_param_file(self):
		
		# template = json.loads(self.schema)
		with open(self.schema) as json_data:
			template = json.load(json_data)
		with open(self.file) as json_data:
			param_file = json.load(json_data)
		tp = self._get_all_keys(template)
		pf = self._get_all_keys(param_file)
		for a in pf:
			if a in tp:
				tp.remove(a)
				if len(tp) == 0:
					break

		print(tp,pf)
		# assert self._get_all_keys(param_file) == self._get_all_keys(template)


	def _get_all_keys(self,param):
		keys = []

		def func(param):
			for key, value in param.items():
				# print(key,value)
				# self.tempkey.append(key)
				if isinstance(value,dict) and bool(value):
					self.tempkey.append(f'{key}.{value}')
					func(value)
				else:
					self.tempkey.append(key)
				# print(key)
			print(self.tempkey)
			self.tempkey = []

